(5, 2, 'sebastiandumitru', 'His book examines how the ever-changing role of colour in society has been reflected in manuscripts, stained\r\nglass, clothing, painting and popular culture. Colour is a natural phenomenon, of course, but it is also a complex\r\ncultural construct that resists generalization and, indeed, analysis itself. No doubt this is why serious works\r\ndevoted to colour are rare, and rarer still are those that aim to study it in historical context. Many authors search\r\nfor the universal or archetypal truths they imagine reside in colour, but for the historian, such truths do not exist.\r\nColour is first and foremost a social phenomenon. There is no transcultural truth to colour perception, despite\r\nwhat many books based on poorly grasped neurobiology or â€“ even worse â€“ on pseudoesoteric pop psychology\r\nwould have us believe. Such books unfortunately clutter the bibliography on the subject, and even do it harm.\r\nThe silence of historians on the subject of colour, or more particularly their difficulty in conceiving colour as a\r\nsubject separate from other historical phenomena, is the result of three different sets of problems. The first\r\nconcerns documentation and preservation. We see the colours transmitted to us by the past as time has altered\r\nthem and not as they were originally. Moreover, we see them under light conditions that often are entirely\r\ndifferent from those known by past societies. And finally, over the decades we have developed the habit of\r\nlooking at objects from the past in black-and-white photographs and, despite the current diffusion of colour\r\nphotography, our ways of thinking about and reacting to these objects seem to have remained more or less black\r\nand white.\r\nThe second set of problems concerns methodology. As soon as the historian seeks to study colour, he must\r\ngrapple with a host of factors all at once: physics, chemistry, materials, and techniques of production, as well as\r\niconography, ideology, and the symbolic meanings that colours convey. How to make sense of all of these\r\nelements? How can one establish an analytical model facilitating the study of images and coloured objects? No\r\nresearcher, no method, has yet been able to resolve these problems, because among the numerous facts\r\npertaining to colour, a researcher tends to select those facts that support his study and to conveniently forget\r\nthose that contradict it. This is clearly a poor way to conduct research. And it is made worse by the temptation\r\nto apply to the objects and images of a given historical period information found in texts of that period. The\r\nproper method â€“ at least in the first phase of analysis â€“ is to proceed as do palaeontologists (who must study\r\ncave paintings without the aid of texts): by extrapolating from the images and the objects themselves a logic and\r\na system based on various concrete factors such as the rate of occurrence of particular objects and motifs, their\r\ndistribution and disposition. In short, one undertakes the internal structural analysis with which any study of an\r\nimage or coloured object should begin.\r\nThe third set of problems is philosophical: it is wrong to project our own conceptions and definitions of colour\r\nonto the images, objects and monuments of past centuries. Our judgements and values are not those of previous\r\nsocieties (and no doubt they will change again in the future). For the writer-historian looking at the definitions\r\nand taxonomy of colour, the danger of anachronism is very real. For example, the spectrum with its natural\r\norder of colours was unknown before the seventeenth century, while the notion of primary and secondary\r\ncolours did not become common until the nineteenth century. These are not eternal notions but stages in the\r\never-changing history of knowledge.\r\nI have reflected on such issues at greater length in my previous work, so while the present book does address\r\ncertain of them, for the most part it is devoted to other topics. Nor is it concerned only with the history of colour\r\nin images and artworks â€“ in any case that area still has many gaps to be filled. Rather, the aim of this book is to\r\nexamine all kinds of objects in order to consider the different facets of the history of colour and to show how far\r\nbeyond the artistic sphere this history reaches. The history of painting is one thing; that of colour is another,\r\nmuch larger, question. Most studies devoted to the history of colour err in considering only the pictorial, artistic\r\nor scientific realms. But the lessons to be learned from colour and its real interest lie elsewhere. \r\n', 'text', 'Negative', -0.1, '2020-03-28'),
(6, 7, 'paula_radulescu', 'Amy normally hated Monday mornings, but this year was different. Kamal was in her art class and she liked Kamal. She was waiting outside the classroom when her friend Tara arrived.\r\n\r\nâ€œHi Amy! Your mum sent me a text. You forgot your inhaler. Why donâ€™t you turn your phone on?â€ Amy didnâ€™t like technology. She never sent text messages and she hated Facebook too.\r\n\r\nâ€œDid Kamal ask you to the disco?â€ Tara was Amyâ€™s best friend, and she wanted to know everything that was happening in Amyâ€™s life. â€œI donâ€™t think he likes me,â€ said Amy. â€œAnd I never see him alone. Heâ€™s always with Grant.â€ Amy and Tara didnâ€™t like Grant.\r\n\r\nâ€œDo you know about their art project?â€ asked Amy. â€œItâ€™s about graffiti, I think,â€ said Tara. â€œTheyâ€™re working on it at the old house behind the factory.â€ â€œBut that building is dangerous,â€ said Amy. â€œAah, are you worried heâ€™s going to get hurt?\" Tara teased. â€œShut up, Tara! Hey look, here they come!â€', 'text', 'Negative', -0.2, '2020-03-29'),
(20, 4, 'timotei_B', 'The first problem is money. You have to earn a considerable amount of money to be able to afford one. The prices of new cars are so high that you usually need to take a credit to buy one. The subsequent costs of insurance, tax and repairs also tend to be quite expensive.', 'text', 'Negative', -2, '2020-03-24'),
(32, 2, 'sebastiandumitru', 'Everything I did in life, until now, was just for tennis. Nothing else mattered. Thatâ€™s why it became too much, maybe. Thatâ€™s why I suffered,â€ Simona Halep says intently on a midwinter afternoon in Bucharest. We sit in a corner of a restaurant where the clinking of cutlery provides a refined backdrop to the raw immediacy of a rare interview with the world No 1.\r\nThere is snow on the ground outside but only warmth from Halep. Beyond her burning intensity she smiles with relief. â€œThere is no pressure now. I feel lighter. I feel better. I wouldnâ€™t have been this relaxed if I hadnâ€™t won the French Open. A big weight is off my shoulders.', 'file', 'Positive', 1.25, '2020-03-30'),
(34, 3, 'ioanacretu', 'A wonderful serenity has taken possession of my entire soul, like these sweet mornings of spring which I enjoy with my whole heart. I am alone, and feel the charm of existence in this spot, which was created for the bliss of souls like mine. I am so happy, my dear friend, so absorbed in the exquisite sense of mere tranquil existence, that I neglect my talents. I should be incapable of drawing a single stroke at the present moment; and yet I feel that I never was a greater artist than now. When, while the lovely valley teems with vapour around me, and the meridian sun strikes the upper surface of the impenetrable foliage of my trees, and but a few stray gleams steal into the inner sanctuary, I throw myself down among the tall grass by the trickling stream; and, as I lie close to the earth, a thousand unknown plants are noticed by me: when I hear the buzz of the little world among the stalks, and grow familiar with the countless indescribable forms of the insects and flies, then I feel the presence of the Almighty, who formed us in his own image, and the breath', 'text', 'Positive', 1.28, '2020-03-23'),
(35, 3, 'ioanacretu', 'But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in which toil and pain can procure him some great pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise, except to obtain some advantage from it? But who has any right to find fault with a man who chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure? On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire, that they cannot foresee', 'file', 'Positive', 0.45, '2020-03-26'),
(36, 2, 'sebastiandumitru', 'I have absolutely no pleasure in the stimulants in which I sometimes so madly indulge. It has not been in the pursuit of pleasure that I have periled life and reputation and reason. It has been the desperate attempt to escape from torturing memories, from a sense of insupportable loneliness and a dread of some strange impending doom.', 'text', 'Negative', -1.1, '2020-03-29'),
(40, 6, 'bogdanvasilica', 'As many countries urge populations to stay at home, many of us are paying more attention to our diets and how the food we eat can support our health. To help sort out the fact from the fiction, BBC Future is updating some of our most popular nutrition stories from our archive.\r\nOur colleagues at BBC Good Food are focusing on practical solutions for ingredient swaps, nutritious storecupboard recipes and all aspects of cooking and eating during lockdown.\r\nAs many of us find ourselves confined to our houses due to social isolation measures, concerns tend to arise about the lack of sunlight â€“ and possible vitamin D deficiency. For many, a go-to fix is to take supplements.\r\nThe supplement, after all, has been touted as a near-miracle. Both vitamin D2 and D3 supplements are available over-the-counter without a prescription and have been linked to improving immunity, tiredness and muscle weakness, bone pain, and depression. Theyâ€™ve also been said to help stave off cancer and the consequences of ageing.\r\nIt may be little wonder that, according to research by market analysis company Mintel, a third of adults in the UK who take vitamin supplements count vitamin D among them.', 'text', 'Positive', 0.47, '2020-04-17'),
(76, 2, 'sebastiandumitru', 'This movie is... horrible and wonderful at the same time. I first saw it when I was about 13 or 14 years old, so it has a great deal of nostalgic value for me. In this movie, Cesar Romero actually plays the character of Octavio, the man who discovered Santana. There are also two other actors, Monte Markham (plays Sam, who is trying to save his daughter) and Peter Mark Richman (plays the priest), who have large filmographies, and these are the only performances that are okay. The rest of the acting and the movie itself have all of the B-film qualities that some of us cherish.I recently spent 2 years trying to acquire a copy of this movie, and it is almost nonexistent. I am assuming that it was discontinued very shortly after its release. But I did eventually find a copy and paid a pretty penny to acquire it. If you happen to come upon Judgement Day in a video store (unmistakeable with a cheesy green satan on the cover), count yourself among the blessed who live near one of the few video stores that still has a working copy. A must see for those of you who like to laugh at cheesy attempts at a scary movie.', 'text', 'Positive', 1, '2020-04-17'),
