(86, 3, 'ioanacretu', 'Around the world, humans are struggling to ignore thousands of years of bio-social convention and avoid touching another. Shaking hands might be one of the hardest customs to lose in the post-pandemic world but there are alternatives, writes James Jeffrey.\r\n\r\nThe humble handshake spans the mundane to the potent, ranging from a simple greeting between strangers who will never meet again, to the sealing of billion-dollar deals between business titans.\r\n\r\nThere are various ideas about the origin of the handshake. It may have originated in ancient Greece as a symbol of peace between two people by showing that neither person was carrying a weapon. Or the shaking gesture of the handshake may have started in Medieval Europe, when knights would shake the hand of others in an attempt to shake loose any hidden weapons.\r\n\r\nThe Quakers are credited with popularising the handshake after they deemed it to be more egalitarian than bowing.\r\n\r\nThe handshake is a â€œliteral gesture of human connectedness,â€œ a symbol of how humans have evolved to be deeply social, tactile-orientated animals, says Cristine Legare, a psychology professor at the University of Texas at Austin.\r\n\r\nWith a history tracing back thousands of years, the handshake may be too entrenched to be easily halted.\r\n\r\nâ€œThe fact we went for the elbow bump as an alternative shows how important touch is - we didn\'t want to lose that physical connecting,â€œ says Prof Legare.\r\n\r\nThat biological drive to touch and be touched is found in other animals as well. In the 1960s American psychologist Harry Harlow demonstrated how vital touch and affection was for the development of young rhesus monkeys.\r\n\r\nWhy going without physical touch is so hard\r\nOther examples from the animal kingdom include our closest cousins: chimpanzees typically touch palms, hug and sometimes kiss as a form of greeting. Giraffes use their necks that can reach two metres in length to engage in a type of behaviour called â€œneckingâ€œ - with male giraffes entwining their neck with each other\'s and swaying and rubbing to assess the other\'s strength and size to establish dominance.\r\n\r\nThat said, numerous forms of human greeting exist around the world that avoid the transmission trap. Many cultures embrace pressing the palms of hands together with fingers pointing up while accompanied by a slight bow, the traditional Hindu Namaste greeting being one of the most well-known.', 'text', 'Positive', 0.52, '2020-05-07'),
(87, 2, 'sebastiandumitru', 'Short Moral Stories - Having A Best Friend\r\n\r\nA story tells that two friends were walking through the desert. During some point of the journey they had an argument, and one friend slapped the other one in the face.\r\n\r\nThe one who got slapped was hurt, but without saying anything, wrote in the sand;\r\n\r\nâ€œToday my best friend slapped me in the face.â€\r\n\r\nThey kept on walking until they found an oasis, where they decided to take a bath. The one who had been slapped got stuck in the mire and started drowning, but the friend saved him. After he recovered from the near drowning, he wrote on a stone;\r\n\r\nâ€œToday my best friend saved my life.â€\r\n\r\nThe friend who had slapped and saved his best friend asked him;\r\n\r\nâ€œAfter I hurt you, you wrote in the sand and now, you write on a stone, why?â€\r\n\r\nThe other friend replied;\r\n\r\nâ€œWhen someone hurts us we should write it down in sand where winds of forgiveness can erase it away. But, when someone does something good for us, we must engrave it in stone where no wind can ever erase it.â€\r\n\r\nMoral of the story: \r\nDonâ€™t value the things you have in your life. But value who you have in your life.', 'text', 'Positive', 0.75, '2020-05-13'),
