(90, 4, 'timotei_B', 'Humans need a reasonably accurate view of the world in order to survive. If your model of reality is wildly different from the actual world, then you struggle to take effective actions each day. \r\n\r\nHowever, truth and accuracy are not the only things that matter to the human mind. Humans also seem to have a deep desire to belong.\r\n\r\nIn Atomic Habits, I wrote, â€œHumans are herd animals. We want to fit in, to bond with others, and to earn the respect and approval of our peers. Such inclinations are essential to our survival. For most of our evolutionary history, our ancestors lived in tribes. Becoming separated from the tribeâ€”or worse, being cast outâ€”was a death sentence.â€\r\n\r\nUnderstanding the truth of a situation is important, but so is remaining part of a tribe. While these two desires often work well together, they occasionally come into conflict.\r\n\r\nIn many circumstances, social connection is actually more helpful to your daily life than understanding the truth of a particular fact or idea. The Harvard psychologist Steven Pinker put it this way, â€œPeople are embraced or condemned according to their beliefs, so one function of the mind may be to hold beliefs that bring the belief-holder the greatest number of allies, protectors, or disciples, rather than beliefs that are most likely to be true.â€ \r\n\r\nWe don\'t always believe things because they are correct. Sometimes we believe things because they make us look good to the people we care about.\r\n\r\nI thought Kevin Simler put it well when he wrote, â€œIf a brain anticipates that it will be rewarded for adopting a particular belief, it\'s perfectly happy to do so, and doesn\'t much care where the reward comes from â€” whether it\'s pragmatic (better outcomes resulting from better decisions), social (better treatment from one\'s peers), or some mix of the two.â€ \r\n\r\nFalse beliefs can be useful in a social sense even if they are not useful in a factual sense. For lack of a better phrase, we might call this approach â€œfactually false, but socially accurate.â€  When we have to choose between the two, people often select friends and family over facts.\r\n\r\nThis insight not only explains why we might hold our tongue at a dinner party or look the other way when our parents say something offensive, but also reveals a better way to change the minds of others.', 'text', 'Positive', 1.03, '2020-05-22'),
(91, 2, 'sebastiandumitru', 'It doesn\'t take long to figure out if something is worth reading. Skilled writing and high-quality ideas stick out.\r\nAs a result, most people should probably start more books than they do. This doesn\'t mean you need to read each book page-by-page. You can skim the table of contents, chapter titles, and subheadings. Pick an interesting section and dive in for a few pages. Maybe flip through the book and glance at any bolded points or tables. In ten minutes, you\'ll have a reasonable idea of how good it is.\r\nThen comes the crucial step: Quit books quickly and without guilt or shame.\r\nLife is too short to waste it on average books. The opportunity cost is too high. There are so many amazing things to read. I think Patrick Collison, the founder of Stripe, put it nicely when he said, â€œLife is too short to not read the very best book you know of right now.â€\r\nHere\'s my recommendation: Start more books. Quit most of them. Read the great ones twice.', 'text', 'Positive', 1.3, '2020-05-22'),
(92, 7, 'paula_radulescu', 'Constraints actually increase our skill development rather than restrict it. We need lines to show us where to add color, not a blank canvas to draw on. As an entrepreneur, I struggled to manage myself until I realized that I needed to add some structure to my day. I began to only schedule calls in the afternoon. I blocked my email inbox until noon. I required myself to publish a new article every Monday and Thursday. By adding a few carefully designed constraints to my life I reduced my freedom, but actually improved my productivity and happiness. Instead of feeling restricted by constraints, I felt empowered.Degrees can be important. (I don\'t want to be operated on by a neurosurgeon who didn\'t attend medical school.) But as my friend Charlie Gilkey told me, â€œMost people need degrees because they don\'t have the courage to ask for what they want.â€ In many cases, the courage to ask for what you want and a willingness to solve other people\'s problems is all you really need. The degrees, the awards, going to the â€œrightâ€ school or being born into the â€œrightâ€ familyâ€”none of these things are a prerequisite for success.', 'text', 'Positive', 0.9, '2020-05-22'),
(93, 4, 'timotei_B', 'I have accepted their proposal, even though it affected my schedule for the rest of the day. ', 'text', 'Neutral', 0, '2020-05-26'),
(94, 2, 'sebastiandumitru', 'https://www.bbc.com/news/world-asia-india-52787972', 'link', 'Positive', 0.24, '2020-05-26'),
(95, 7, 'paula_radulescu', 'https://www.bbc.com/news/world-europe-52784120', 'link', 'Negative', -0.56, '2020-05-26'),
(96, 1, 'eduardpopa', 'I usually have a tough time with chick flicks, and it was with great chagrin that I learned that the Friday rental of the house would be Eat Pray Love starring (arguably the chick flick queen) Julia Roberts. I thought I would hate it, I expected to see a sappy tear-jerker with Roberts playing her usual character.\r\n\r\nExactly what I got. Roberts almost cruelly and certainly suddenly/without warning leaves her husband (Billy Crudup) to travel the world, visiting Rome to Eat, India to Pray, and Bali to Love. During her adventures she meets Javier Bardem, Richard Jenkins, and many others.\r\n\r\nWon\'t lie, I enjoyed quite a bit of this. A lot of the film is Julia Roberts being Julia Roberts, treading no new ground and playing her usual boring role. But, I suppose, that was the point. The character she plays is boring and normal, and even when she travels across the world Roberts does little to show the changes her character experiences. Can\'t say I really liked her character, which provided a bizarre feeling for the entirety of the movie. Was I supposed to root for Julia? Who knows.\r\n\r\nEPL has some remarkable cinematography that deserves noting. I was surprised it wasn\'t nodded towards at the Oscars this year; shots of all these countries are beautifully represented. The script lags the most in Rome, but really picks up in India and Bali. As I said, Roberts is an unsympathetic character, but each travel experience brings interesting characters. Richard Jenkins, undoubtedly the most underrated actors ever, shines in his role of Richard from Texas in India. Bardem is good as well, but that\'s not a surprise. These two are the bright spots here.\r\n\r\nIf you\'ve seen the trailer you\'ve seen the movie, but if you\'re not looking for that much I think you\'ll be as surprised as I was. Worth it for the cinematography and characters. Plus, for that Friday-night chick flick your girlfriend picks out, you could do worse.', 'text', 'Negative', -0.21, '2020-05-28'),
(97, 1, 'eduardpopa', 'Even people who experienced mild symptoms of Covid-19 could still have acquired immunity for several weeks or more, according to a new study in French healthcare workers. The news is promising as it suggests mild Covid-19 cases might hold some protection against re-infection, but itâ€™s worth remembering that immunity can be a very fiddly and fickle thing, especially when it comes to this new and little understood virus.\r\n\r\nResearchers from Strasbourg University Hospital and the Pasteur Institute studied 160 French healthcare workers who contracted Covid-19, but only experienced mild symptoms and did not require hospitalization. Blood samples revealed that almost all of the patients developed antibodies to Covid-19 within 15 days of the infection, while up to 98 percent of them still had neutralizing antibodies after 28 days. \r\n\r\nThe neutralizing activity of antibodies also appeared to increase over time, with neutralizing antibodies detected in 79 percent of samples 13-20 days after the onset of symptoms, and then in 92 percent of samples after 21-27 days, followed by 98 percent after 28-41 days.\r\n\r\nâ€œIt was known that people with severe forms of the disease developed antibodies within 15 days of the onset of the signs. We now know that this is also true for those who have minor forms, even if the antibody levels are probably lower,â€ Arnaud Fontanet, one of the authors of the study and head of the Global Health department at the Institute Pastor, said in a statement. \r\n\r\nThe study, which has not yet been peer-reviewed, was recently released by the researchers and available to read on the pre-print server MedRxiv.\r\n\r\nThe researchers say their findings suggest people who have been infected with Covid-19, even if they experienced only mild symptoms, have protection against reinfection of SARS-CoV-2, the coronavirus that causes Covid-19, for â€œat least up to 40 days after the onset of signs.â€ However, it remains unclear whether this protection lasts for longer. \r\n\r\nImmunity to any virus isn\'t simply black-and-white, but rather a spectrum â€“ one can experience a continuum of infection levels from zero to full infection and everything in between. Even if you have antibodies to a specific virus, it doesnâ€™t necessarily mean you are totally protected from the infection. Equally, levels of immunity can progressively slip as time goes on. Furthermore, immunity is not all about antibodies; the immune response to a pathogen also relies on a well-trained army of B cells (the white blood cell that secretes antibodies) and T-cells (which directly kill cells that have been infected by an invader).\r\n\r\nThis new research looks promising but is not a guarantee that people who have had a mild Covid-19 infection will have any lengthy, meaningful immunity to reinfection. The team is hoping to investigate this further by looking at the patientsâ€™ antibody response and its associated neutralization capacity in the long term.\r\n\r\nâ€œYes, we have good results for a month but we have no way of predicting how long this will last,â€ Kevin AriÃ«n, professor of virology at the Institute of Tropical Medicine Antwerp, who was not directly involved in this study, told the Financial Times. â€œWe presume that people infected in this first wave of Covid-19 will be protected if thereâ€™s a second wave in the autumn, but we donâ€™t really know what will happen.â€\r\n							', 'text', 'Positive', 0.06, '2020-05-28'),
(98, 1, 'eduardpopa', 'https://www.iflscience.com/editors-blog/heyyyy-duuuuuude-researchers-study-100-billion-tweets-to-characterize-stretchable-words/', 'link', 'Positive', 1.13, '2020-05-28'),
(99, 1, 'eduardpopa', 'Wow. I\'ve always admired Julia Roberts, and was wondering how she would transition to a more mature actress. Not well. \r\nWhy in the world would she have read this abomination of a script, and said, â€œYes, I want to do that movie!â€œ? \r\nAnd the other fine actors must have agreed because Roberts signed on. \r\nAll the talent in this film can\'t correct the atrocious script.', 'text', 'Positive', 1.8, '2020-06-28'),
(100, 1, 'eduardpopa', 'When I read the book last year, I had just lost my job, was looking for a new one and eating everything that was bad for me, so I enjoyed Liz\'s misery and newfound joys. \r\nBut now that I\'m content, in this new phase of life, I find myself annoyed by people who create their own drama and then whine about it.', 'file', 'Negative', -2.5, '2020-06-28'),
